      y_local[3] = m_y[i][j+1][k];                                                  
      y_local[4] = m_y[i+1][j][k];                                                  
      y_local[5] = m_y[i+1][j][k+1];                                                
      y_local[6] = m_y[i+1][j+1][k+1];                                              
      y_local[7] = m_y[i+1][j+1][k];                                                

      z_local[0] = m_z[i][j][k];                                                    
      z_local[1] = m_z[i][j][k+1];                                                  
